// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ReputationSystem {
    uint constant totalClients = 50; // Total number of clients

    // Mapping from round number to (client index to reputation score)
    mapping(uint => mapping(uint => uint)) public reputationScores;

    // Function to set the reputation scores for a given round
    function setReputationScores(uint round, uint[] calldata scores) external {
        require(scores.length == totalClients, "Scores array length must match total clients.");

        for (uint i = 0; i < totalClients; i++) {
            reputationScores[round][i] = scores[i];
        }
    }

    // Function to get the reputation score for a specific client in a specific round
    function getReputationScore(uint round, uint clientIndex) external view returns (uint) {
        require(clientIndex < totalClients, "Invalid client index.");
        return reputationScores[round][clientIndex];
    }
}

